import React, { useEffect, useState } from "react";
import axios from "axios";

export default function DashboardPage() {
  const [results, setResults] = useState([]);
  const [message, setMessage] = useState("");
  const token = localStorage.getItem("promptpal_token");

  useEffect(() => {
    axios
      .get("http://localhost:8080/api/prompt", {
        headers: { Authorization: `Bearer ${token}` },
      })
      .then((res) => setResults(res.data))
      .catch(() => setMessage("No results found"));
  }, []);

  const generateAdvice = async () => {
    try {
      const res = await axios.post(
        "http://localhost:8080/api/prompt/generate",
        {},
        { headers: { Authorization: `Bearer ${token}` } }
      );
      setResults([res.data, ...results]);
    } catch (err) {
      setMessage("Failed to generate advice.");
    }
  };

  return (
    <div className="card">
      <h2>AI Personalized Advice</h2>
      <button className="primary" onClick={generateAdvice}>
        Generate New
      </button>
      {message && <p>{message}</p>}
      {results.map((r) => (
        <div key={r.id} className="card">
          <strong>Prompt:</strong>
          <p>{r.prompt_text}</p>
          <strong>Response:</strong>
          <p>{r.ai_response}</p>
        </div>
      ))}
    </div>
  );
}
